import {Link, Route, Routes } from "react-router-dom";
import {Work} from "./pages/Work";
import {Services} from "./pages/Services";
import {Agency} from "./pages/Agency";
import {Blog} from "./pages/Blog";
function App() {
  return (
    <>
    <header class="d-flex flex-wrap align-items-center container-fluid justify-content-center justify-content-md-between py-3 mb-4 bg-dark">
      <Link class="d-flex align-items-center col-md-3 mb-2 mb-md-0 text-decoration-none" to="/"> LOGO</Link>
      <ul class="nav col-12 col-md-auto mb-2 justify-content-center mb-md-0">
        <li><Link class="nav-link" to="/work">Work</Link></li>
        <li><Link class="nav-link" to="/services">Services</Link></li>
        <li><Link class="nav-link" to="/Agency">Agency</Link></li>
        <li><Link class="nav-link" to="/blog">Blog</Link></li>
      </ul>
      <div class="col-md-3 text-end">
        <button type="button" class="btn btn-primary">Get In Touch</button>
      </div>
    </header>
  <Routes>
    <Route path="/work" element={<Work />} />
    <Route path="/services" element={<Services />} />
    <Route path="/agency" element={<Agency />} />
    <Route path="/blog" element={<Blog />} />
  </Routes> 

  </>
  );
}

export default App;
